import React from "react";
import {LiWrapper} from "./webcomps";
import PropTypes from "prop-types";
import styled from 'styled-components';

import SectionTitle from "./sectionTitle";
const StyleText = styled.span`
    color: ${props => props.hexCode} !important;
`;
const TaskList = (props) => {
  console.log(props, '<><><><>');
  const { listHeader, taskList } = props;
  const itemList = taskList.title.split(taskList.hightLight);
  if (itemList.length === 1) {
    itemList.push('');
  }
  return(
    <div>
        <SectionTitle title={listHeader}/>
        <ul>
        {itemList.map(item => (
          <LiWrapper>
              <span>{itemList[0]}</span>
              <StyleText hexCode={taskList.hexCode}>{taskList.hightLight}</StyleText>
              <span>{itemList[1]}</span>
          </LiWrapper>  
        ))}
        </ul>
    </div>
  );
};

TaskList.propTypes = {
    listHeader: PropTypes.string.isRequired,
    taskList: PropTypes.object.isRequired,
};

export default TaskList;
